INSERT INTO `wp_posts` VALUES (1,3,'2019-03-09 04:09:29','2019-03-09 04:09:29','<!-- wp:paragraph -->\n<p><strong>Trở lại đầy ngoạn mục cùng lễ Kick off “Run Up The Sunshine – Đường đua rực nắng” ngày 17/4, Sunshine Group đã chứng minh độ “chịu chơi” và sức hút không thể cưỡng lại từ siêu dự án tích hợp công nghệ 4.0 Sunshine City Sài Gòn.</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Bùng nổ với hàng nghìn sales tham dự</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Sau thành công vang dội từ sự kiện chào sân thị trường bất động sản phía Nam, lần trở lại đầy ấn tượng này, Sunshine City Sài Gòn đã tạo nên hiệu ứng bùng nổ và phá cách với nhiều dư vị cảm xúc.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Ngay từ sáng sớm, sảnh GEM Center đã chật cứng các chiến binh sales đến từ 40 sàn và đại lý phân phối, đủ để chứng minh sức hút khó cưỡng đến từ siêu phẩm căn hộ Sunshine City Sài Gòn.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":68,\"align\":\"center\",\"width\":640,\"height\":480} -->\n<div class=\"wp-block-image\"><figure class=\"aligncenter is-resized\"><img src=\"http://diaockhainam.muathemewordpress.net/wp-content/uploads/2019/03/man-nhan-cung-le-kick-off-run-up-the-sunshine-den-tu-sunshine-group.jpeg\" alt=\"\" class=\"wp-image-68\" width=\"640\" height=\"480\"/></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>\n\nSự kiện lấy cảm hứng từ hành trình luyện rèn của 1 vận động viên marathon phải trải qua những khắc nghiệt, vượt mọi khó khăn thử thách để làm chủ cung đường, vươn lên trở thành nhà vô địch. Lễ Kick off “Run Up The Sunshine – Đường đua rực nắng” diễn ra trong tâm thế ngóng chờ và hào hứng của đội ngũ sales đối với dự án căn hộ công nghệ độc đáo ngay trung tâm Quận 7, Tp. HCM. Chủ đầu tư Sunshine Group muốn truyền đi ngọn lửa đam mê, tinh thần hăng say, quyết liệt “dám nghĩ, dám làm” cho những đối tác, đại lý phân phối của mình.\n\n</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>\n\nChương trình được mở đầu bằng sự xuất hiện của các vũ công phiêu cùng âm nhạc, với sân khấu được dàn dựng công phu cùng nghệ thuật trình diễn đỉnh cao. Tiết mục để lại cho người xem nhiều ấn tượng choáng ngợp.\n\n</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>\n\nCả khán phòng dường như vỡ òa trong cảm xúc thăng hoa khi đại diện chủ đầu tư, đại lý phân phối, thủ lĩnh sàn xuất hiện hoành tráng từ cánh gà với ngọn cờ đua trong tay, biến hóa thành những vũ công thực thụ khi kết hợp cùng nhóm nhảy. Sự xuất hiện đầy bất ngờ này tạo nên hiệu ứng bùng nổ, tất cả đồng lòng hô vang khẩu hiệu tiếp lửa, gây dựng niềm tin cho những chiến binh sales trên hành trình bứt phá vượt giới hạn và cùng nhau thi đua giành chiến thắng.\n\n</p>\n<!-- /wp:paragraph -->','Mãn nhãn cùng lễ kick off “Run Up The Sunshine” đến từ Sunshine Group','','publish','closed','open','','man-nhan-cung-le-kick-off-run-up-the-sunshine-den-tu-sunshine-group','','','2021-05-22 17:22:21','2021-05-22 10:22:21','',0,'http://demo8.vietlac.info/khonggianthugian/?p=1',0,'post','',0),(2,3,'2019-03-09 04:09:29','2019-03-09 04:09:29','[section label=\"Banner\" padding=\"0px\"]\n\n[ux_banner label=\"Banner\" height=\"100%\" bg=\"61\" bg_size=\"original\"]\n\n[text_box width=\"90\" scale=\"230\" scale__sm=\"340\" scale__md=\"300\" position_x=\"50\" position_y=\"75\" position_y__sm=\"70\"]\n\n[title style=\"center\" text=\"Sunshine City SaiGon\" margin_bottom=\"0px\" size=\"40\" class=\"mh-title-simple center mh-hight-light\"]\n\n<p class=\"svn\">Tinh hoa Châu Âu - Khởi đầu thịnh vượng</p>\n\n[/text_box]\n[text_box width=\"15\" width__sm=\"45\" width__md=\"20\" scale=\"90\" scale__sm=\"130\" position_x=\"50\" position_y=\"95\"]\n\n[row label=\"Button\" style=\"collapse\" h_align=\"center\"]\n\n[col span=\"6\" span__sm=\"6\"]\n\n[featured_box img=\"66\" img_width=\"58\" pos=\"center\" link=\"https://www.youtube.com/watch?v=WjnfFWkvTIg\" class=\"open-video\"]\n\n\n[/featured_box]\n\n[/col]\n[col span=\"6\" span__sm=\"6\"]\n\n[featured_box img=\"67\" img_width=\"58\" pos=\"center\" link=\"https://my.matterport.com/show/?m=uRGXgoiYk9f&play=1&qs=1\" target=\"_blank\"]\n\n\n[/featured_box]\n\n[/col]\n\n[/row]\n\n[/text_box]\n\n[/ux_banner]\n\n[/section]\n[section label=\"Tổng quan ...\" padding=\"60px\"]\n\n[row label=\"Tiêu đề\" style=\"small\"]\n\n[col span__sm=\"12\" align=\"center\"]\n\n<h2 class=\"mh-title-bold-light\">Tổng quan<span>Sunshine City Saigon</span></h2>\n\n[/col]\n\n[/row]\n[row label=\"Tabs Giới thiệu\" style=\"small\"]\n\n[col span__sm=\"12\" class=\"mh-tabs-introduce\"]\n\n[tabgroup style=\"divided\" align=\"center\"]\n\n[tab title=\"Giới thiệu\"]\n\n[row_inner label=\"Tổng quan ...\" v_align=\"middle\" h_align=\"right\" class=\"mh-row-introduce-bg\"]\n\n[col_inner span=\"8\" span__sm=\"12\" span__md=\"7\" padding=\"30px 0px 0px 0px\"]\n\n[ux_image id=\"78\" image_size=\"original\"]\n\n\n[/col_inner]\n[col_inner span=\"4\" span__sm=\"10\" span__md=\"5\" padding=\"30px 0px 0px 20px\" color=\"light\"]\n\n[title text=\"Giới thiệu\" margin_bottom=\"10px\" size=\"140\" class=\"mh-title-simple\"]\n\n<p>Lấy cảm hứng từ những thành phố thịnh vượng châu Âu, Sunshine City Sài Gòn tiếp nối thành công của Sunshine City Hà Nội ở phía Bắc, trở thành biểu tượng thượng lưu ở phía Nam.</p>\n[button text=\"Xem thêm\" color=\"secondary\" style=\"underline\" class=\"mh-button-italic\"]\n\n\n[/col_inner]\n\n[/row_inner]\n\n[/tab]\n[tab title=\"Chủ đầu tư\"]\n\n[row_inner label=\"Chủ đầu tư\" v_align=\"middle\" h_align=\"right\" padding=\"30px 0px 0px 0px\" class=\"mh-row-introduce-bg\"]\n\n[col_inner span=\"8\" span__sm=\"12\" span__md=\"7\" padding=\"30px 0px 0px 0px\"]\n\n[ux_image id=\"77\" image_size=\"original\"]\n\n\n[/col_inner]\n[col_inner span=\"4\" span__sm=\"10\" span__md=\"5\" padding=\"30px 0px 0px 20px\" color=\"light\"]\n\n[title text=\"Chủ đầu tư\" margin_bottom=\"10px\" size=\"140\" class=\"mh-title-simple\"]\n\n<p>Sunshine Group với chiến lược mũi nhọn là đầu tư kinh doanh bất động sản, đã và đang tập trung phát triển hơn 20 dự án hạng sang trên khắp cả nước. Năm 2018, Sunshine Group chính thức chào sân thị trường TP. Hồ Chí Minh với dự án quy mô cực khủng Sunshine City Sài Gòn.</p>\n[button text=\"Xem thêm\" color=\"secondary\" style=\"underline\" class=\"mh-button-italic\"]\n\n\n[/col_inner]\n\n[/row_inner]\n\n[/tab]\n\n[/tabgroup]\n\n[/col]\n\n[/row]\n\n[/section]\n[section label=\"Vị trí ...\" bg=\"79\" bg_size=\"original\" padding=\"80px\" class=\"mh-no-padding-bottom\"]\n\n[row label=\"Vị trí ...\"]\n\n[col span=\"6\" span__sm=\"12\" span__md=\"12\" color=\"light\"]\n\n<h2 class=\"mh-title-bold-color\">Vị trí<br /><span>Trung tâm đắt giá</span></h2>\n[gap height=\"20px\"]\n\n<p class=\"mh-text-justify\">Sunshine City Sài Gòn tọa lạc tại Quận 7 – một trong số những quận trung tâm và có tốc độ phát triển nhanh nhất của TP. Hồ Chí Minh.</p>\n<p class=\"mh-text-justify\">Dự án có vị trí đắc địa nhìn ra dòng sông Cả Cấm hiền hòa, thuận tiện kết nối vào trung tâm thông qua hệ thống cầu đường hiện đại bắc qua những kênh rạch tự nhiên của thành phố.</p>\n<p class=\"mh-text-justify\">Liền kề Khu đô thị Phú Mỹ Hưng, vùng lõi huyết mạch của Quận 7, Sunshine City Sài Gòn được thừa hưởng toàn bộ tiện ích của khu vực với những bệnh viện, trường học hàng đầu, bên cạnh đó là các điểm giải trí đẳng cấp phục vụ cuộc sống thượng lưu.</p>\n\n[/col]\n[col span=\"6\" span__sm=\"12\" span__md=\"12\" color=\"light\"]\n\n[ux_image id=\"81\" image_size=\"original\"]\n\n\n[/col]\n\n[/row]\n[gap height=\"60px\"]\n\n[row label=\"Vị trí ...\" style=\"collapse\" width=\"full-width\"]\n\n[col span=\"2\" span__sm=\"12\" span__md=\"4\" color=\"light\" class=\"mh-col-location\"]\n\n<div class=\"mh-point\"></div>\n<div class=\"mh-time\">2 phút</div>\n<ul class=\"mh-list-location\">\n<li><span>Trung tâm tài chính Phú Mỹ Hưng</span></li>\n<li><span>Trung tâm hành chính Quận 7</span></li>\n<li><span>Trường Quốc tế Nhật Bản</span></li>\n<li><span>Trường Quốc tế Hàn Quốc</span></li>\n<li><span>Trường Quốc tế Đài Loan</span></li>\n</ul>\n[gap visibility=\"show-for-medium\"]\n\n\n[/col]\n[col span=\"2\" span__sm=\"12\" span__md=\"4\" color=\"light\" class=\"mh-col-location\"]\n\n<div class=\"mh-point\"></div>\n<div class=\"mh-time\">4 phút</div>\n<ul class=\"mh-list-location\">\n<li><span>Trung tâm triển lãm SECC</span></li>\n<li><span>Crescent Mall</span></li>\n<li><span>Công viên Hồ Bán Nguyệt</span></li>\n<li><span>Trường liên cấp Nam Sài Gòn</span></li>\n<li><span>Trường Đinh Thiện Lý</span></li>\n<li><span>Trường Quốc tế liên cấp Việt Úc</span></li>\n</ul>\n[gap visibility=\"show-for-medium\"]\n\n\n[/col]\n[col span=\"2\" span__sm=\"12\" span__md=\"4\" color=\"light\" class=\"mh-col-location\"]\n\n<div class=\"mh-point\"></div>\n<div class=\"mh-time\">5 phút</div>\n<ul class=\"mh-list-location\">\n<li><span>Bệnh viện Quận 7</span></li>\n<li><span>Bệnh viện FV</span></li>\n<li><span>Bệnh viện tim Tâm Đức</span></li>\n<li><span>Sân tập Golf Phú Mỹ Hưng</span></li>\n</ul>\n[gap visibility=\"show-for-medium\"]\n\n\n[/col]\n[col span=\"2\" span__sm=\"12\" span__md=\"4\" color=\"light\" class=\"mh-col-location\"]\n\n<div class=\"mh-point\"></div>\n<div class=\"mh-time\">8 phút</div>\n<ul class=\"mh-list-location\">\n<li><span>Đại học Tôn Đức Thắng</span></li>\n<li><span>Đại học RMIT</span></li>\n</ul>\n[gap visibility=\"show-for-medium\"]\n\n\n[/col]\n[col span=\"2\" span__sm=\"12\" span__md=\"4\" color=\"light\" class=\"mh-col-location\"]\n\n<div class=\"mh-point\"></div>\n<div class=\"mh-time\">10 phút</div>\n<ul class=\"mh-list-location\">\n<li><span>Trung tâm quận 1</span></li>\n<li><span>Phố đi bộ Nguyễn Huệ</span></li>\n</ul>\n[gap visibility=\"show-for-medium\"]\n\n\n[/col]\n[col span=\"2\" span__sm=\"12\" span__md=\"4\" color=\"light\" class=\"mh-col-location\"]\n\n<div class=\"mh-point\"></div>\n<div class=\"mh-time\">25 phút</div>\n<ul class=\"mh-list-location\">\n<li><span>Cảng hàng không Quốc tế Tân Sơn Nhất</span></li>\n</ul>\n[gap visibility=\"show-for-medium\"]\n\n\n[/col]\n\n[/row]\n[gap height=\"60px\"]\n\n\n[/section]\n[section label=\"Giá trị vàng ...\" padding=\"0px\"]\n\n[ux_slider label=\"Giá trị vàng ...\" arrows=\"false\" nav_style=\"simple\" bullet_style=\"simple\"]\n\n[ux_banner label=\"Giá trị vàng ...\" height=\"100%\" bg=\"82\" bg_size=\"original\" class=\"mh-banner-overlay\"]\n\n[text_box width=\"75\" width__sm=\"90\" width__md=\"90\" scale__sm=\"90\" position_x=\"0\" position_x__sm=\"5\" position_x__md=\"5\" position_y=\"50\" position_y__sm=\"30\" position_y__md=\"25\" text_align=\"left\"]\n\n[title text=\"Giá trị vàng của Sunshine City Sai Gon\" margin_bottom=\"20px\" class=\"mh-title-simple mh-hight-light left\"]\n\n\n[/text_box]\n[text_box width__sm=\"80\" scale__sm=\"100\" margin=\"30px 0px 0px 30px\" margin__sm=\"30px 0px 0px 20px\" padding=\"0px 0px 30px 30px\" padding__sm=\"0px 0px 20px 20px\" position_x=\"0\" position_x__sm=\"0\" position_x__md=\"5\" position_y=\"85\" position_y__sm=\"85\" position_y__md=\"75\" text_align=\"left\" border=\"0px 0px 0px 2px\" border_color=\"rgb(201, 146, 50)\"]\n\n<p class=\"uppercase mh-font-size-normal\">Nội thất hoàng kim</p>\n[gap height=\"20px\"]\n\n<p class=\"mh-text-justify\">Đẳng cấp “luxury” thể hiện trong những chi tiết nhấn nhá đầy dụng ý của thiết kế, sự tỉ mỉ, tinh tế của nội thất cao cấp mạ vàng đến từ những thương hiệu lừng danh thế giới. Một sự xa hoa xứng đáng dành cho những chủ nhân đích thực, nơi căn hộ không chỉ là tổ ấm, mà còn là một chỉ dấu của cuộc sống thành đạt, vương giả.</p>\n\n[/text_box]\n\n[/ux_banner]\n[ux_banner label=\"Giá trị vàng ...\" height=\"100%\" bg=\"61\" bg_size=\"original\" class=\"mh-banner-overlay\"]\n\n[text_box width=\"75\" width__sm=\"90\" width__md=\"90\" scale__sm=\"90\" position_x=\"0\" position_x__sm=\"5\" position_x__md=\"5\" position_y=\"50\" position_y__sm=\"30\" position_y__md=\"25\" text_align=\"left\"]\n\n[title text=\"Giá trị vàng của Sunshine City Sai Gon\" margin_bottom=\"20px\" class=\"mh-title-simple mh-hight-light left\"]\n\n\n[/text_box]\n[text_box width__sm=\"80\" scale__sm=\"110\" margin=\"30px 0px 0px 30px\" margin__sm=\"30px 0px 0px 20px\" padding=\"0px 0px 30px 30px\" padding__sm=\"0px 0px 20px 20px\" position_x=\"0\" position_x__sm=\"0\" position_x__md=\"5\" position_y=\"90\" position_y__sm=\"90\" position_y__md=\"80\" text_align=\"left\" border=\"0px 0px 0px 2px\" border_color=\"rgb(201, 146, 50)\"]\n\n<p class=\"uppercase mh-font-size-normal\">Tầm nhìn khoáng đạt</p>\n[gap height=\"20px\"]\n\n<p class=\"mh-text-justify\">Nhờ vị trí đắc địa giữa hai sông, mỗi căn hộ Sunshine City Sài Gòn đều có tầm nhìn khoáng đạt ra dòng Cả Cấm hiền hòa, sông Sài Gòn hùng vĩ hay những khu vườn nội khu trải dài ngút tầm mắt. Mỗi buổi bình minh sẽ đem đến những ánh nắng rực rỡ và bầu không khí tươi mới cho các “Cư Dân Mặt Trời” tràn đầy năng lượng hứng khởi, bắt đầu một ngày làm việc đầy nhiệt huyết.</p>\n\n[/text_box]\n\n[/ux_banner]\n[ux_banner label=\"Giá trị vàng ...\" height=\"100%\" bg=\"83\" bg_size=\"original\" class=\"mh-banner-overlay\"]\n\n[text_box width=\"75\" width__sm=\"90\" width__md=\"90\" scale__sm=\"90\" position_x=\"0\" position_x__sm=\"5\" position_x__md=\"5\" position_y=\"30\" position_y__sm=\"10\" position_y__md=\"10\" text_align=\"left\"]\n\n[title text=\"Giá trị vàng của Sunshine City Sai Gon\" margin_bottom=\"20px\" class=\"mh-title-simple mh-hight-light left\"]\n\n\n[/text_box]\n[text_box width__sm=\"80\" scale__sm=\"100\" margin=\"30px 0px 0px 30px\" margin__sm=\"30px 0px 0px 20px\" padding=\"0px 0px 30px 30px\" padding__sm=\"0px 0px 20px 20px\" position_x=\"0\" position_x__sm=\"0\" position_x__md=\"5\" position_y=\"90\" position_y__sm=\"90\" position_y__md=\"90\" text_align=\"left\" border=\"0px 0px 0px 2px\" border_color=\"rgb(201, 146, 50)\"]\n\n<p class=\"uppercase mh-font-size-normal\">Hệ sinh thái đồng bộ</p>\n[gap height=\"20px\"]\n\n<p class=\"mh-text-justify\">Không đứng ngoài xu hướng chung của thời đại, Sunshine Group tiên phong dẫn đầu công nghệ 4.0, mang đến một cuộc sống thông minh đúng nghĩa tại Sunshine City Sài Gòn. Thẻ cư dân thông minh tích hợp những tiện ích trong khu căn hộ, cho phép cư dân ra vào tòa nhà cũng như các không gian công cộng, đồng thời mang tính năng của một chiếc thẻ ngân hàng với hạn mức lên đến 300 triệu đồng để cư dân thỏa sức mua sắm, chi tiêu cho cuộc sống. Ngoài ra, cư dân có thể điều khiển các thiết bị trong căn hộ thông qua ứng dụng Sunshine Home tiện lợi. Đồng thời giữ liên lạc với Chủ đầu tư, Đơn vị quản lý cũng như gọi các dịch vụ chỉ thông qua một ứng dụng duy nhất trên chiếc điện thoại nhỏ của mình.</p>\n\n[/text_box]\n\n[/ux_banner]\n\n[/ux_slider]\n\n[/section]\n[section label=\"Chuỗi tiện ích ...\" padding=\"100px\" class=\"mh-no-padding-bottom mh-bg-half\"]\n\n[row label=\"Chuỗi tiện ích ...\" style=\"collapse\" width=\"full-width\" h_align=\"right\" class=\"mh-row-utilities\"]\n\n[col span=\"6\" span__sm=\"12\" span__md=\"12\" padding=\"0px 15px 0px 15px\" color=\"light\"]\n\n<h2 class=\"mh-title-bold-light mh-color-primary\"><span>Chuỗi tiện ích</span> đỉnh cao</h2>\n[gap height=\"60px\"]\n\n<p>Với diện tích lớn dành cho không gian cảnh quan và tiện ích, Sunshine City Sài Gòn là xứ sở của cuộc sống hiện đại, dẫn dầu xu hướng tương lai. Dịch vụ chuẩn 5 sao quốc tế cùng hệ thống quản lý – vận hành ứng dụng công nghệ thông minh được khai thác hoàn hảo tài Sunshine City, nơi hội tụ trọn vẹn của những chuẩn mực giá trị sống.</p>\n[gap height=\"10px\"]\n\n[row_inner label=\"Chuỗi tiện ích\"]\n\n[col_inner span=\"6\" span__sm=\"12\" class=\"mh-col-utilities\"]\n\n<ul class=\"mh-list-location\">\n<li><span>Sân chơi thể thao đa năng</span></li>\n<li><span>Hồ cảnh quan</span></li>\n<li><span>Sảnh lounge đón khách</span></li>\n<li><span>Hầm để xe lien tòa</span></li>\n<li><span>Bể bơi vô cực</span></li>\n<li><span>Thư viện</span></li>\n<li><span>Thác tràn nghệ thuật</span></li>\n<li><span>Rooftop City Bar</span></li>\n<li><span>S - Cafe</span></li>\n</ul>\n\n[/col_inner]\n[col_inner span=\"6\" span__sm=\"12\" class=\"mh-col-utilities\"]\n\n<ul class=\"mh-list-location\">\n<li><span>Trường mầm non Maple Bear</span></li>\n<li><span>Nhà hàng Á-Âu</span></li>\n<li><span>S - Mart</span></li>\n<li><span>S - Fitness and Spa</span></li>\n<li><span>Khu vui chơi trẻ em</span></li>\n<li><span>Khu vui chơi trẻ em</span></li>\n<li><span>Vườn nướng BBQ</span></li>\n<li><span>Cầu đi bộ liên tòa</span></li>\n</ul>\n\n[/col_inner]\n\n[/row_inner]\n[gap height=\"10px\"]\n\n\n[/col]\n[col span=\"6\" span__sm=\"12\" span__md=\"12\"]\n\n[ux_slider label=\"Slider Chuỗi tiện ...\" nav_style=\"simple\" bullets=\"false\"]\n\n[ux_image id=\"86\" image_size=\"original\"]\n\n[ux_image id=\"85\" image_size=\"original\"]\n\n[ux_image id=\"84\" image_size=\"original\"]\n\n\n[/ux_slider]\n\n[/col]\n\n[/row]\n\n[/section]\n[section label=\"Hệ sinh thái ...\" padding=\"0px\"]\n\n[row label=\"Hệ sinh thái ...\" style=\"collapse\" width=\"full-width\" v_align=\"equal\"]\n\n[col span=\"6\" span__sm=\"12\" span__md=\"12\"]\n\n[ux_image id=\"87\" image_size=\"original\" height=\"75%\"]\n\n\n[/col]\n[col span=\"6\" span__sm=\"12\" span__md=\"12\" force_first=\"medium\" padding=\"50px 100px 0px 50px\" class=\"mh-col-padding-small mh-col-ecosystem\"]\n\n[gap height=\"40px\" visibility=\"show-for-small\"]\n\n[title text=\"Hệ sinh thái Sunshine\" margin_bottom=\"20px\" size=\"150\" class=\"mh-title-simple bold\"]\n\n<p>Không đứng ngoài xu hướng của thời đại, Sunshine Group tiên phong dẫn đầu công nghệ 4.0, mang đến một cuộc sống thông minh đúng nghĩa tại Sunshine City Sài Gòn.</p>\n<p>Thẻ cư dân thông minh tích hợp những tiện ích trong khu căn hộ, cho phép cư dân ra vào tòa nhà cũng như các không gian công cộng, đồng thời mang tính năng của một chiếc thẻ ngân hàng với hạn mức lên đến 300 triệu đồng để cư dân thỏa sức mua sắm, chi tiêu cho cuộc sống.</p>\n<p>Ngoài ra, cư dân có thể điều khiển các thiết bị trong căn hộ thông qua ứng dụng Sunshine Home tiện lợi. Đồng thời giữ liên lạc với chủ đầu tư, Đơn vị quản lý cũng như gọi các dịch vụ khác chỉ thông qua một ứng dụng duy nhất trên chiếc điện thoại nhỏ của mình.</p>\n[gap height=\"50px\" visibility=\"show-for-medium hide-for-small\"]\n\n\n[/col]\n\n[/row]\n[row label=\"Slider\" style=\"collapse\" width=\"full-width\" h_align=\"right\" class=\"mh-slider-ecosystem\"]\n\n[col span__sm=\"12\" span__md=\"12\" padding=\"0px 0px 0px 100px\" class=\"mh-col-padding-small\"]\n\n[gap height=\"29px\" visibility=\"show-for-medium\"]\n\n[ux_slider label=\"Slider\" slide_width=\"300px\" nav_style=\"simple\" bullets=\"false\"]\n\n[ux_image id=\"89\" image_size=\"original\" margin=\"0px 5px 0px 5px\"]\n\n[ux_image id=\"90\" image_size=\"original\" margin=\"0px 5px 0px 5px\"]\n\n[ux_image id=\"91\" image_size=\"original\" margin=\"0px 5px 0px 5px\"]\n\n[ux_image id=\"92\" image_size=\"original\" margin=\"0px 5px 0px 5px\"]\n\n\n[/ux_slider]\n\n[/col]\n\n[/row]\n[gap height=\"130px\" visibility=\"hidden\"]\n\n\n[/section]\n[section label=\"Tin tức ...\" padding=\"80px\" class=\"mh-no-padding-bottom\"]\n\n[row label=\"Tin tức ...\" h_align=\"center\"]\n\n[col span__sm=\"12\" align=\"center\"]\n\n<h2 class=\"mh-title-bold-light mh-color-primary\">Tin tức<span> Sunshine City SaiGon</span></h2>\n[gap height=\"50px\"]\n\n[blog_posts style=\"default\" type=\"row\" columns=\"3\" columns__md=\"2\" cat=\"18\" posts=\"3\" title_style=\"uppercase\" readmore=\"Đọc tiếp\" readmore_color=\"secondary\" readmore_style=\"link\" badge_style=\"square\" comments=\"false\" image_height=\"56.25%\" image_size=\"original\" text_align=\"left\" text_padding=\"20px 0px 0px 0px\" class=\"mh-col-no-divider mh-grid-blog\"]\n\n\n[/col]\n\n[/row]\n[gap]\n\n\n[/section]','Trang chủ','','publish','closed','closed','','trang-chu','','','2019-10-29 11:02:59','2019-10-29 04:02:59','',0,'http://demo8.vietlac.info/khonggianthugian/?page_id=2',0,'page','',0