-28 15:47:31','2019-05-28 08:47:31','',0,'http://diaockhainam.muathemewordpress.net/wp-content/uploads/2019/05/logo.png',0,'attachment','image/png',0),(61,3,'2019-05-28 16:35:24','2019-05-28 09:35:24','','banner','','inherit','open','closed','','banner','','','2019-05-28 16:35:24','2019-05-28 09:35:24','',0,'http://diaockhainam.muathemewordpress.net/wp-content/uploads/2019/05/banner.jpg',0,'attachment','image/jpeg',0),(66,3,'2019-05-28 19:06:07','2019-05-28 12:06:07','','play','','inherit','open','closed','','play','','','2019-05-28 19:06:07','2019-05-28 12:06:07','',0,'http://diaockhainam.muathemewordpress.net/wp-content/uploads/2019/05/play.png',0,'attachment','image/png',0),(67,3,'2019-05-28 19:06:08','2019-05-28 12:06:08','','video','','inherit','open','closed','','video','','','2019-05-28 19:06:08','2019-05-28 12:06:08','',0,'http://diaockhainam.muathemewordpress.net/wp-content/uploads/2019/05/video.png',0,'attachment','image/png',0),(68,3,'2019-05-28 19:43:05','2019-05-28 12:43:05','','man-nhan-cung-le-kick-off-run-up-the-sunshine-den-tu-sunshine-group','','inherit','open','closed','','man-nhan-cung-le-kick-off-run-up-the-sunshine-den-tu-sunshine-group','','','2019-05-28 19:43:05','2019-05-28 12:43:05','',1,'http://diaockhainam.muathemewordpress.net/wp-content/uploads/2019/03/man-nhan-cung-le-kick-off-run-up-the-sunshine-den-tu-sunshine-group.jpeg',0,'attachment','image/jpeg',0),(69,3,'2019-05-28 21:12:35','2019-05-28 14:12:35','<!-- wp:paragraph -->\n<p>Thử tưởng tượng, chỉ với một chiếc smartphone, trước khi rời công sở trở về căn hộ, bạn chỉ cần bấm nút “Về nhà”, rèm cửa sẽ tự động mở, nóng lạnh sẽ tự động bật, một bản nhạc êm dịu sẽ được bật lên chờ sẵn… để sau một ngày làm việc mệt mỏi, bạn có thể được nghỉ ngơi, tận hưởng một cuộc sống nhẹ nhàng, thư giãn, có thời gian trải nghiệm các tiện ích sẵn có của tòa nhà như spa – sauna, gym, bơi lội…</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Rồi đêm về, điều hòa cũng sẽ tự động chuyển sang chế độ giấc ngủ sâu, đèn sẽ tự điều chỉnh về mức độ sáng nhẹ ban đêm và các rèm cửa tự động đóng lại tạo cảm giác yên tĩnh cho một giấc ngủ an lành…</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Trong một clip đậm chất trực quan công nghệ vừa hé lộ mới đây của Sunshine City Sài Gòn – khu dự án cao cấp tại quận 7, vị trí trung tâm Nam Sài Gòn, người xem có thể cảm nhận được cuộc sống VIP đúng nghĩa khi các cư dân Sunshine nhận được hỗ trợ kịp thời từ những việc nhỏ nhất.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Đơn giản như được thông báo về chỗ trống trong nhà xe qua ứng dụng “bãi đỗ xe và thông báo chỗ trống”; hệ thống chuông hình kỹ thuật số kiểm soát khách đến thăm, loa thông minh ra lệnh bằng giọng nói; khóa cửa cảm biến vân tay,… Đặc biệt, thấu hiểu cư dân mất nhiều thời gian xuất trình thẻ hay làm các thủ tục giấy tờ check – in, Sunshine đã đưa vào sử dụng hệ thống kiểm soát an ninh FaceID giúp nhận diện khuôn mặt nhanh chóng khi ra vào các khu tiện ích công cộng như bể bơi, phòng tập Gym, thư viện,…</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":70,\"align\":\"center\",\"width\":640,\"height\":480} -->\n<div class=\"wp-block-image\"><figure class=\"aligncenter is-resized\"><img src=\"http://diaockhainam.muathemewordpress.net/wp-content/uploads/2019/05/khong-con-me-nha-tay-dan-viet-gio-chuong-nhung-can-ho-smarthome-cua-sunshine.jpg\" alt=\"\" class=\"wp-image-70\" width=\"640\" height=\"480\"/></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Tại dự án Sunshine City Sài Gòn, trong cùng một căn hộ có tới 10 hạng mục như khoá thông minh, chuông hình, rèm tự động, điều hoà nhiệt độ, các cảm biến, đồng hồ điện, nước, chiếu sáng, bình nóng lạnh… tất cả đều được điều khiển bằng một ứng dụng duy nhất.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Không chỉ Sunshine City Sài Gòn, ở các khu đô thị đẳng cấp khác của Sunshine Group, mọi trải nghiệm sống tiện nghi đều được kích hoạt mượt mà, đồng bộ chỉ bằng một nút chạm. Nhờ những ứng dụng công nghệ hiện đại này, Sunshine Group đã và đang được thị trường trong nước và quốc tế đánh giá là doanh nghiệp tiên phong đưa công nghệ 4.0 vào bất động sản.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Với lợi thế từ một nhà phát triển phần mềm tự động hóa trong và ngoài nước, trong khi nhiều “ông lớn” bất động sản khác phải đi mua công nghệ từ bên ngoài thì Sunshine ngay từ khi bước chân sang địa hạt BĐS (đầu năm 2014) đã lựa chọn con đường tự nghiên cứu và phát triển các sản phẩm công nghệ tân tiến, hiện đại nhằm tối ưu hoá chi phí, mang lại trải nghiệm tốt nhất cho khách hàng của mình, đồng thời, tạo nên một lợi thế cạnh tranh đáng kể trên thị trường.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Theo đó, các thiết bị công nghệ trong căn hộ, dự án mang “họ Sunshine Group” ứng dụng trí tuệ nhân tạo và internet vạn vật (IoT), không chỉ hiện đại và thông minh mà còn phải được thiết kế đồng bộ, vận hành trong cùng một hệ sinh thái Sunshine.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>“Đầu tư phát triển và làm chủ công nghệ là quá trình lâu dài và tốn kém, nhưng với mục đích mang khoa học công nghệ để phục vụ tốt nhất, tiện lợi nhất cho cư dân, cho khách hàng, chúng tôi sẽ luôn kiên trì và phấn đấu cho mục tiêu đó!”, một đại diện của Sunshine chia sẻ.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Cùng trải nghiệm cuộc sống công nghệ như trong mơ tại Sunshine City Sài Gòn qua clip dưới đây:</p>\n<!-- /wp:paragraph -->','Không còn mê “nhà Tây”, dân Việt giờ chuộng những căn hộ smarthome của Sunshine','','publish','closed','closed','','khong-con-me-nha-tay-dan-viet-gio-chuong-nhung-can-ho-smarthome-cua-sunshine','','','2021-05-22 17:22:21','2021-05-22 10:22:21','',0,'http://diaockhainam.muathemewordpress.net/?p=69',0,'post','',0),(70,3,'2019-05-28 21:11:32','2019-05-28 14:11:32','','khong-con-me-nha-tay-dan-viet-gio-chuong-nhung-can-ho-smarthome-cua-sunshine','','inherit','open','closed','','khong-con-me-nha-tay-dan-viet-gio-chuong-nhung-can-ho-smarthome-cua-sunshine','','','2019-05-28 21:11:32','2019-05-28 14:11:32','',69,'http://diaockhainam.muathemewordpress.net/wp-content/uploads/2019/05/khong-con-me-nha-tay-dan-viet-gio-chuong-nhung-can-ho-smarthome-cua-sunshine.jpg',0,'attachment','image/jpeg',0),(72,3,'2019-05-28 21:17:09','2019-05-28 14:17:09','<!-- wp:paragraph -->\n<p>Với địa thế tương đương khu Manhattan (TP. New York, Mỹ), bán đảo Thủ Thiêm sau hơn 22 năm phát triển hạ tầng đã trở thành điểm đến màu mỡ của các siêu dự án bất động sản lớn nhất Việt Nam. Nhưng dường như tại đây vẫn còn thiếu các sản phẩm “meta-luxury” đang là xu hướng mới thu hút các khách hàng siêu giàu trên thế giới.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Trung tâm mới của TP.HCM, mỏ vàng bất động sản Thủ Thiêm hút dự án lớn&nbsp;</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Thị trường bất động sản Việt Nam bắt đầu hút mạnh khách mua nước ngoài từ năm 2015 và nở rộ mạnh mẽ từ đó đến nay. Các nhà đầu tư chủ yếu đến từ Singapore, Hàn Quốc, Trung Quốc Đại Lục và Hong Kong… đều đánh giá thị trường Việt Nam sẽ mang lại mức lợi nhuận hấp dẫn.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Nhờ tốc độ phát triển cao và ổn định, TP.HCM là lựa chọn mà các nhà đầu tư bất động sản quốc tế muốn rót tiền vào Việt Nam. Các đơn vị nghiên cứu thị trường cho biết, giá căn hộ ở TP.HCM dù tăng nhanh nhưng vẫn chưa cao bằng Bangkok, Manila, Kuala Lumpur, Singapore, và Hong Kong. Do đó, phân khúc căn hộ tại TP.HCM đặc biệt thu hút đầu tư, nhất&nbsp;là khu đô thị Thủ Thiêm – nơi định hình hạ tầng đầy đủ với quy hoạch rõ nét để trở thành một trung tâm mới.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Hiện 99% diện tích đất tại khu đô thị Thủ Thiêm đã được bồi thường giải tỏa, với 382 ha đất phát triển nhà ở và 334 ha đất khác để phát triển các khu thương mại. Một loạt những siêu dự án với vốn đầu tư hàng tỷ USD của nhiều tập đoàn lớn trong và ngoài nước đang chờ triển khai.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":73,\"align\":\"center\",\"width\":640,\"height\":480} -->\n<div class=\"wp-block-image\"><figure class=\"aligncenter is-resized\"><img src=\"http://diaockhainam.muathemewordpress.net/wp-content/uploads/2019/05/trung-tam-moi-cua-tp-hcm-khat-can-ho-sieu-cao-cap.jpg\" alt=\"\" class=\"wp-image-73\" width=\"640\" height=\"480\"/></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Hệ thống giao thông thuận lợi đã được “bồi đắp” suốt hơn 20 năm là một thế mạnh lớn đưa Thủ Thiêm thành trung tâm mới của thành phố. Theo quy hoạch, ngoài hầm Thủ Thiêm còn có 10 cây cầu nối khu đô thị Thủ Thiêm tới quận 1 và các quận khác bên kia sông. Hiện 2 cây cầu đã hoàn thành.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Tuyến đường xương sống của Thủ Thiêm là Đại lộ Mai Chí Thọ thuộc tuyến Đại lộ Đông Tây với 12 làn xe hoạt động từ năm 2011, hai bên đường đã có các dự án bất động sản được xây dựng dày đặc. Trong khu đô thị có 4 tuyến đường chính đã gần hoàn thiện đầy đủ gồm: đại lộ vòng cung, đường ven hồ trung tâm, đường ven sông Sài Gòn và đường vùng châu thổ.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Nhìn rõ lợi thế này, nhiều “ông lớn” bất động sản cả nội và ngoại đã rót tiền đầu tư không dưới 20 siêu dự án tổ hợp nhà ở, văn phòng và trung tâm thương mại tại Thủ Thiêm.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>“Cơn khát” dự án căn hộ siêu cao cấp view sông</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Phần bờ sông của Thủ Thiêm nhìn từ quận 1 mang vẻ đẹp tựa như khu Lower Manhattan của TP.&nbsp;New York (Mỹ) bên dòng Hudson. Có lẽ đây cũng là một trong những đặc điểm, cùng với quy hoạch của cơ quan chức năng, khiến nhiều nhà đầu tư định hình được giá trị của khu đất trong tương lai để sẵn sàng bỏ vốn phát triển dự án lớn.</p>\n<!-- /wp:paragraph -->','Trung tâm mới của TP.HCM “khát” căn hộ siêu cao cấp','','publish','closed','closed','','trung-tam-moi-cua-tp-hcm-khat-can-ho-sieu-cao-cap','','','2021-05-22 17:22:21','2021-05-22 10:22:21','',0,'http://diaockhainam.muathemewordpress.net/?p=72',0,'post','',0),(73,3,'2019-05-28 21:19:14','2019-05-28 14:19:14','','trung-tam-moi-cua-tp-hcm-khat-can-ho-sieu-cao-cap','','inherit','open','closed','','trung-tam-moi-cua-tp-hcm-khat-can-ho-sieu-cao-cap-2','','','2019-05-28 21:19:14','2019-05-28 14:19:14','',72,'http://diaockhainam.muathemewordpress.net/wp-content/uploads/2019/05/trung-tam-moi-cua-tp-hcm-khat-can-ho-sieu-cao-cap.jpg',0,'attachment','image/jpeg',0),(74,3,'2019-05-28 21:24:11','2019-05-28 14:24:11','<!-- wp:paragraph -->\n<p>Gần đây, giới đầu tư và kinh doanh địa ốc Sài Gòn khá xôn xao, trước một số thông tin rò rỉ cho thấy nhiều khả năng, Sunshine Group sẽ vươn dài cánh tay đến TP. Hồ Chí Minh, sau khi thâu tóm thành công các khu “đất vàng” tại Nha Trang, Hà Nội, cùng tuyên bố tái cấu trúc thị trường bất động sản siêu sang bằng các dòng sản phẩm chiến lược.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Sunshine Group – “ông lớn” về nhà công nghệ và kiến trúc đẹp</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Từ khoảng nửa cuối năm 2018, giới thạo tin bắt đầu rỉ tai nhau về việc Tập đoàn Sunshine Group rục rịch khởi động hành trình “Nam tiến”, có thể coi là một bước đi mới đầy tính chiến lược, sau khi chủ đầu tư này đã có những thành công đáng nể tại thị trường bất động sản (BĐS) Hà Nội, với với loạt dự án quy mô nghìn tỷ, ở các vị trí “vàng ” ngay trong nội đô Hà Nội như Sunshine Riverside (Nhật Tân – Tây Hồ), Sunshine Palace (Hoàng Mai), Sunshine Garden (Vĩnh Tuy), Sunshine Center (Phạm Hùng – Nam Từ Liêm), Sunshine City (KĐT Nam Thăng Long – Ciputra, Hà Nội)…</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Hiện tại trên thị trường BĐS, Sunshine Group đang được coi là một “ông lớn” về nhà công nghệ và kiến trúc, ánh sáng hiện đại, góp phần không nhỏ làm thay đổi diện mạo các khu đô thị, chung cư cao cấp tại Việt Nam. “Top 100 Thương hiệu mạnh Việt Nam 2017”, “Top 10 doanh nghiệp BĐS tốt nhất Việt Nam 2017”… là một số ví dụ cho thấy sự ghi nhận của thị trường đối với các lĩnh vực hoạt động của Sunshine Group. Cùng với đó, trong khuôn khổ giải thưởng danh giá Dot Property Awards 2018 dành riêng cho BĐS, 2 trong số các dự án cao cấp của Sunshine cũng đã được xướng tên: Sunshine City Hà Nội (giải thưởng “Nhà ở hạng sang tốt nhất Việt Nam 2018”) và Sunshine Marina Nha Trang Bay (giải thưởng “Công trình mang tính biểu tượng Việt Nam 2018”).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Không chỉ tạo dựng tên tuổi ở phân khúc chung cư cao cấp, gần đây, Sunshine Group tiếp tục gây chú ý bằng công bố sắp ra mắt 3 dòng sản phẩm mới: Sunshine Sky Villas (biệt thự trên không), Sunshine Villas (biệt thự sinh thái nghỉ dưỡng nội đô), Sunshine Marina (nghỉ dưỡng đa trải nghiệm theo mô hình phức hợp Integrated Resort), nhằm hiện thực hoá chiến lược tái cấu trúc thị trường BĐS siêu sang. Tiềm lực tài chính vững mạnh và khả năng thâu tóm các quỹ đất giá trị, hiện đang là những “key word” hàng đầu định vị tên tuổi Sunshine Group, khi trên một số kênh truyền thông đã bắt đầu có những thông tin, dù chưa chính thức, về các dự án mới của Tâp đoàn tại Hà Nội: Sunshine Golf View, Sunshine Boulevard, Sunshine Lake View, Sunshine Diamond In Golf…</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Ngoài ra, không thể không nhắc tới các lĩnh vực phát triển song song khác của Sunshine, nhằm kiến tạo và phát triển một “hệ sinh thái Sunshine” phục vụ cho nhu cầu của cư dân từ A đến Z: Trường học, Thương mại và Thương maị điện tử, Dịch vụ, Công nghệ… Trong đó, nổi trội nhất phải kể tới hệ thống chuỗi giáo dục Sunshine School liên cấp (từ mầm non đến THPT), được xây dựng hoàn toàn theo mô hình và quy chuẩn quốc tế.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Nhân tố mới của “sân chơi” BĐS Sài Gòn</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Không dừng lại ở việc tái cấu trúc thị trường BĐS phía Bắc, những động thái gần đây của Sunshine Group cho thấy, Tập đoàn này sẽ tiếp tục “đổ bộ” vào thị trường BĐS TP. HCM, và sẽ là một sự xuất hiện khá đình đám, không chỉ bằng một dự án đơn lẻ.</p>\n<!-- /wp:paragraph -->','Sunshine Group chính thức đổ bộ Sài Gòn','','publish','closed','closed','','sunshine-group-chinh-thuc-do-bo-sai-gon','','','2021-05-22 17:22:21','2021-05-22 10:22:21','',0,'http://diaockhainam.muathemewordpress.net/?p=74',0,'post','',0),(75,3,'2019-05-28 21:24:03','2019-05-28 14:24:03','','sunshine-group-chinh-thuc-do-bo-sai-gon','','inherit','open','closed','','sunshine-group-chinh-thuc-do-bo-sai-gon','','','2019-05-28 21:24:03','2019-05-28 14:24:03','',74,'http://diaockhainam.muathemewordpress.net/wp-content/uploads/2019/05/sunshine-group-chinh-thuc-do-bo-sai-gon.jpg',0,'attachment','image/jpeg',0),(77,3,'2019-05-29 16:19:02','2019-05-29 09:19:02','','banner-chu-dau-tu','','inherit','open','closed','','banner-chu-dau-tu','','','2019-05-29 16:19:02','2019-05-29 09:19:02','',0,'http://diaockhainam.muathemewordpress.net/wp-content/uploads/2019/05/banner-chu-dau-tu.jpg',0,'attachment','image/jpeg',0),(78,3,'2019-05-29 16:19:04','2019-05-29 09:19:04','','banner-gioi-thieu','','inherit','open','closed','','banner-gioi-thieu','','','2019-05-29 16:19:04','2019-05-29 09:19:04','',0,'http://diaockhainam.muathemewordpress.net/wp-content/uploads/2019/05/banner-gioi-thieu.jpg',0,'attachment','image/jpeg',0),(79,3,'2019-05-29 21:33:13','2019-05-29 14:33:13','','bg-location','','inherit','open','closed','','bg-location','','','2019-05-29 21:33:13','2019-05-29 14:33:13','',0,'http://diaockhainam.muathemewordpress.net/wp-content/uploads/2019/05/bg-location.jpg',0,'attachment','image/jpeg',0),(81,3,'2019-05-29 21:33:18','2019-05-29 14:33:18','','vi-tri-trung-tam','','inherit','open','closed','','vi-tri-trung-tam','','','2019-05-29 21:33:18','2019-05-29 14:33:18','',0,'http://diaockhainam.muathemewo