ow label=\"Tabs Giới thiệu\" style=\"small\"]\n\n[col span__sm=\"12\" class=\"mh-tabs-introduce\"]\n\n[tabgroup style=\"divided\" align=\"center\"]\n\n[tab title=\"Giới thiệu\"]\n\n[row_inner label=\"Tổng quan ...\" v_align=\"middle\" h_align=\"right\" class=\"mh-row-introduce-bg\"]\n\n[col_inner span=\"8\" span__sm=\"12\" span__md=\"7\" padding=\"30px 0px 0px 0px\"]\n\n[ux_image id=\"78\" image_size=\"original\"]\n\n\n[/col_inner]\n[col_inner span=\"4\" span__sm=\"10\" span__md=\"5\" padding=\"30px 0px 0px 20px\" color=\"light\"]\n\n[title text=\"Giới thiệu\" margin_bottom=\"10px\" size=\"140\" class=\"mh-title-simple\"]\n\n<p>Lấy cảm hứng từ những thành phố thịnh vượng châu Âu, Sunshine City Sài Gòn tiếp nối thành công của Sunshine City Hà Nội ở phía Bắc, trở thành biểu tượng thượng lưu ở phía Nam.</p>\n[button text=\"Xem thêm\" color=\"secondary\" style=\"underline\" class=\"mh-button-italic\"]\n\n\n[/col_inner]\n\n[/row_inner]\n\n[/tab]\n[tab title=\"Chủ đầu tư\"]\n\n[row_inner label=\"Chủ đầu tư\" v_align=\"middle\" h_align=\"right\" padding=\"30px 0px 0px 0px\" class=\"mh-row-introduce-bg\"]\n\n[col_inner span=\"8\" span__sm=\"12\" span__md=\"7\" padding=\"30px 0px 0px 0px\"]\n\n[ux_image id=\"77\" image_size=\"original\"]\n\n\n[/col_inner]\n[col_inner span=\"4\" span__sm=\"10\" span__md=\"5\" padding=\"30px 0px 0px 20px\" color=\"light\"]\n\n[title text=\"Chủ đầu tư\" margin_bottom=\"10px\" size=\"140\" class=\"mh-title-simple\"]\n\n<p>Sunshine Group với chiến lược mũi nhọn là đầu tư kinh doanh bất động sản, đã và đang tập trung phát triển hơn 20 dự án hạng sang trên khắp cả nước. Năm 2018, Sunshine Group chính thức chào sân thị trường TP. Hồ Chí Minh với dự án quy mô cực khủng Sunshine City Sài Gòn.</p>\n[button text=\"Xem thêm\" color=\"secondary\" style=\"underline\" class=\"mh-button-italic\"]\n\n\n[/col_inner]\n\n[/row_inner]\n\n[/tab]\n\n[/tabgroup]\n\n[/col]\n\n[/row]\n\n[/section]\n[section label=\"Vị trí ...\" bg=\"79\" bg_size=\"original\" padding=\