le\":\"Using the Settings page\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/central\\/settings\\/\",\"order\":0},{\"title\":\"Connecting your sites to Wordfence Central\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/central\\/connect\\/\",\"order\":1},{\"title\":\"Setting up two-factor authentication\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/central\\/2fa\\/\",\"order\":2},{\"title\":\"Using the Dashboard page\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/central\\/central\\/\",\"order\":3},{\"title\":\"Viewing scan Findings\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/central\\/findings\\/\",\"order\":4},{\"title\":\"Using the Configuration page\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/central\\/configuration\\/\",\"order\":5},{\"title\":\"Using Wordfence plugin options Templates\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/central\\/templates\\/\",\"order\":6}],\"order\":0},{\"title\":\"Dashboard\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/dashboard\\/\",\"excerpt\":\"The Wordfence Dashboard provides insight into the current state of your site’s security.\",\"children\":[{\"title\":\"Options\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/dashboard\\/options\\/\",\"order\":0},{\"title\":\"Alerts\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/dashboard\\/alerts\\/\",\"order\":1}],\"order\":1},{\"title\":\"Firewall\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/firewall\\/\",\"excerpt\":\"The Wordfence Web Application Firewall is a PHP based, application level firewall that filters out malicious requests to your site. \",\"children\":[{\"title\":\"Optimizing\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/firewall\\/optimizing-the-firewall\\/\",\"order\":0},{\"title\":\"Learning Mode\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/firewall\\/learning-mode\\/\",\"order\":1},{\"title\":\"Statistics\",\"permalink\":\"https: