ce.com\\/help\\/scan\\/troubleshooting\\/\",\"order\":3}],\"order\":4},{\"title\":\"Tools\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/tools\\/\",\"excerpt\":\"Wordfence Tools include Two Factor Authentication, Whois Lookup, Password Audit, Live Traffic and Diagnostics.\",\"children\":[{\"title\":\"Import\\/Export\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/tools\\/import-export\\/\",\"order\":0},{\"title\":\"Password Auditing\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/tools\\/password-auditing\\/\",\"order\":1},{\"title\":\"Whois Lookup\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/tools\\/whois-lookup\\/\",\"order\":2},{\"title\":\"Diagnostics\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/tools\\/diagnostics\\/\",\"order\":3},{\"title\":\"Live Traffic\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/tools\\/live-traffic\\/\",\"order\":4},{\"title\":\"Two-Factor Authentication\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/tools\\/two-factor-authentication\\/\",\"order\":5},{\"title\":\"Legacy Two-Factor Authentication\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/tools\\/legacy-two-factor-authentication\\/\",\"order\":6}],\"order\":5},{\"title\":\"Login Security\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/login-security\\/\",\"excerpt\":\"The Login Security page currently contains settings for two-factor authentication (2FA) and reCAPTCHA. In a future Wordfence version, existing login-related features will also move to the same page.\",\"order\":6},{\"title\":\"Advanced\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/advanced\\/\",\"excerpt\":\"If you want to know more about the technical details of Wordfence, you\'ll find the answers in this section.\",\"children\":[{\"title\":\"System requirements\",\"permalink\":\"https:\\/\\/www.wordfence.com\\/help\\/advanced\\/system-requirements\\/\",\"order\":0},{\"title\":\"Changelog\",\"permalink\":\"https:\\/\